(*:Keywords:
  Johnson solids, uniform polyhedra, Netlib database
*)

(*:Requirements:

  http://mathworld.wolfram.com/packages/MiscPolyhedra.m
	is required for exact Johnson solid constructions
  http://mathworld.wolfram.com/packages/PolyhedronOperations.m
	is required to actaully build the polyhedra and nets based on vertex and face 
	information contained in this package

*)

(*:Discussion:
  The original Bell Labs netlib database is accessible at:  
  
    http://netlib.bell-labs.com/netlib/polyhedra/
    
  The solids have been renumbered to start at 1 instead of 0, so in this
  package, Solid[1] is the tetrahedron.  To get J#, subtract 45 from Netlib 
  number.

  Several of the :solid entires have been corrected by George Hart:
  
    http://www.li.net/~george/virtual-polyhedra/netlib-info.html
  
  However, Hart removed the :net entries in the process, so I've added
  them back in. I've also corrected the erroneous nets (which Hart did not
  consider).  Here are the modifications made to the netlib entries:
  
  Hart      (george@li.net)      corrected :solids 66, 67, 68, 69, 81, 115
  Weisstein (eww@wolfram.com)    corrected :solids 70
                                 added     :solids 0, 9, 10, 11, 12,
                                                   (15, 16, 17, 18, 19, 20, 21)
                                 corrected :nets   66, 67, 68, 69, 81, 115
                                 
  1999-07-09: corrected analytic value for N81/J37 :net vertex
               -3.098076212[_] to [(-1/2-(3/2)Sqrt(3))]
              Added and corrected analytic net vertices for N137: tetrahemihexahedron
              Corrected analaytic net vertices for N138: octahemioctahedron
  1999-07-30: Fixed truncated octahedron solid in JohnsonSolids.dat
  2000-05-23: Added missing vertex 
              -3.2672194889332209, 1.3461181078064268, -1.5554725849995636
              and corrected last three faces of solid after notification by Jean Denel,
              JeanDenel@aol.com
  2002-09-09: Fixed NetFaces[1] (tetrahedron)
*)

(*:Limitations:

  The analytic vertices of the nets are not necessarily in FullSimplified form.
  
  The author hasn't finished computing all Johnsons analytically yet
  
  What I should do is insert the explicit coordinates of Johnson solids
  instead of relying on routines in Prism.m
*)


BeginPackage["MathWorld`JohnsonSolids`",{"MathWorld`PolyhedronOperations`","MathWorld`Prisms`"}]

JohnsonSolid::usage =
"Polyhedron[JohnsonSolid[n]] gives a list of Polygons \
representing the nth Johnson solid.  Similarly, PolyhedronFaces[JohnsonSolid[n]], \
PolyhedronVertices[JohnsonSolid[n]], PolyhedronName[JohnsonSolid[n]], \
Net[JohnsonSolid[n]], NetFaces[JohnsonSolid[n]], and \
NetVertices[JohnsonSolid[n]] can be used.  Not all Johnson solids have \
exact vertices yet."

JohnsonSolids::usage =
"JohnsonSolids gives a list of the 92 Johnson solids."


Begin["`Private`"]

(* JohnsonSolids *)

JohnsonSolids:=JohnsonSolid/@Range[92]

